  return (
    <div>
      <div>
        <input name="fullname" placeholder="Fullname"></input>
      </div>
      <div>
        <input name="phone_number" placeholder="Phone Number"></input>
      </div>
      <div>
        <button>Add</button>
      </div>
    </div>
  );
}

export default Form;
